import React, { Component } from 'react';

class Default extends Component {
    render() {
        return (
            <div>
                <div className='text-center text-align-center mx-auto my-auto btn btn-danger'>page not found at location<b> {this.props.location.pathname}</b></div>
            </div>
        );
    }
}

export default Default;
